   (let [c (.get contours i)
      m2f (new-matofpoint2f (.toArray c))
      len (arc-length m2f true)
      ret (new-matofpoint2f)
      approx (approx-poly-dp m2f ret (* 0.1 len) true)
      nb-sides (.size (.toList ret))]
